import React from 'react';
import './App.css';
import shuffle from './Shuffle'; // shuffle function from https://stackoverflow.com/a/2450976/1293256
import picArray from './Array'; // our array of image names and IDs

console.log("picArray:");
console.log(picArray);

var shuffledArray = shuffle(picArray.slice());

console.log("shuffledArray:");
console.log(shuffledArray);



function App() {
  return (
    <div className="App">
      <div id="header">
        <span>Logo Goes Here</span> <span>You guessed right/wrong!</span> <span>Score: 12 | Top Score: 12</span>
      </div>
      <div id="second-header">
        <h1>Clicky Game</h1>
        <p>Click on an image to earn points, but don't click on any more than once!</p>
      </div>
      <div id="gameBody">
        {
          shuffledArray.map(item => {
            <img src={"./images/" + item[1]} alt="Redshirt Image" width="100" id={item[0]}/>
          })
        }

        <img src="./images/1.png" alt="1" width="100"/>
        <img src="./images/2.jpg" alt="2" width="100"/>
        <img src="./images/3.jpg" alt="3" width="100"/>
        <img src="./images/4.png" alt="4" width="100"/>
        <img src="./images/5.png" alt="5" width="100"/>
        <img src="./images/6.jpg" alt="6" width="100"/>
        <img src="./images/7.jpg" alt="7" width="100"/>
        <img src="./images/8.jpg" alt="8" width="100"/>
        <img src="./images/9.jpg" alt="9" width="100"/>
        <img src="./images/10.jpg" alt="10" width="100"/>

      </div>
      <div id="footer">
        <p>Some footer stuff</p>
      </div>
    </div>
  );
}

export default App;
